  console.log('header lang ', this.props.lang);
  return (
      <header className="header">
        <a href="/">
          <img src="/images/check1.png"/>
          <h3 className ="logo-text">Todoapp</h3>
        </a>
      <MenuLinks menuLinks={menuLinks,this.props.lang}/>
   </header>
    );
}

export default Header;
